import React from 'react';
//import { Header } from '../home-element/Header';
//import { Footer } from '../home-element/Footer';
import TextField from '@material-ui/core/TextField';
import { makeStyles } from '@material-ui/core/styles';
import InputLabel from '@material-ui/core/InputLabel';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import NativeSelect from '@material-ui/core/NativeSelect';
import FilledInput from '@material-ui/core/FilledInput';
import Input from '@material-ui/core/Input';
import OutlinedInput from '@material-ui/core/OutlinedInput';
/*
* Purpose: Estilo predefinido/predeterminado. 
*/
const useStyles = makeStyles((theme) => ({
    formControl: {
      margin: theme.spacing(1),
      minWidth: 120,
    },
    selectEmpty: {
      marginTop: theme.spacing(2),
    },
    root: {
        '& .MuiTextField-root': {
          margin: theme.spacing(2),
          width: '22ch',
        },
      },
  }
  ));


/**
  *  @author : juan felipe osorio zapata <juan.felipe.osorio@correounivalle.edu.co>
  *  @decs  : Componente de categorias de las personas dentro de la App. 
*/

export function Categorias(props) {
    const [name, setName] = React.useState('Cat in the Hat');
    const classes = useStyles();
    const [state, setState] = React.useState({
      age: '',
      name: 'hai',
    });

    const handleChange = (event) => {
      const name = event.target.name;
      setState({
        ...state,
        [name]: event.target.value,
      });
    };

    /*
    return (
            <div>
            <form className={classes.root} noValidate autoComplete="off">
            <TextField id="standard-basic" label="Estandar" />
            <TextField id="filled-basic" label="Filled" variant="filled" />
            <TextField id="outlined-basic" label="Outlined" variant="outlined" />
            </form>
            </div>
    )
    */
   return (
    <div>
      <h1>Categorias Usuarios</h1>
      <FormControl className={classes.formControl}>
        <InputLabel htmlFor="user-native-simple">Tipo Usuario</InputLabel>
        <Select
          native
          value={state.user}
          onChange={handleChange}
          inputProps={{
            name: 'user',
            id: 'user-native-simple',
          }}
        >
          <option aria-label="None" value="" />
          <option>Sistemas</option>
          <option>Administrativo</option>
          <option>Asistente Administrativo</option>
          <option>Pastor local</option>
          <option>Cómite</option>
          <option>Creyente</option>
        </Select>
      </FormControl>

      <FormControl className={classes.formControl}>
        <InputLabel htmlFor="sexo-native-helper">Sexo</InputLabel>
        <NativeSelect
          value={state.nombre}
          onChange={handleChange}
          inputProps={{
            name: 'Sexo',
            id: 'sexo-native-helper',
          }}
        > 
        <option aria-label="None" value="" />
        <option>Masculino</option>
        <option>Femenino</option>
        <option>No Definido</option>
        </NativeSelect>
        <FormHelperText>...</FormHelperText>
      </FormControl>

      <FormControl>
      <form className={classes.root} noValidate autoComplete="on">
      <div>
      <TextField
          id="outlined-uncontrolled"
          label="Nombre"
          variant="outlined"
        />
      </div>
      </form>
      </FormControl>

      <FormControl>
      <form className={classes.root} noValidate autoComplete="on">
      <div>
      <TextField
          id="outlined-uncontrolled"
          label="Apellido"
          variant="outlined"
        />
      </div>
      </form>
      </FormControl>

      <FormControl className={classes.formControl}>
        <InputLabel htmlFor="uncontrolled-native">Name</InputLabel>
        <NativeSelect
          defaultValue={30}
          inputProps={{
            name: 'name',
            id: 'uncontrolled-native',
          }}
        >
          <option value={10}>Ten</option>
          <option value={20}>Twenty</option>
          <option value={30}>Thirty</option>
        </NativeSelect>
        <FormHelperText>Uncontrolled</FormHelperText>
      </FormControl>
      <FormControl className={classes.formControl}>
        <NativeSelect
          className={classes.selectEmpty}
          value={state.age}
          name="age"
          onChange={handleChange}
          inputProps={{ 'aria-label': 'age' }}
        >
          <option value="" disabled>
            Placeholder
          </option>
          <option value={10}>Ten</option>
          <option value={20}>Twenty</option>
          <option value={30}>Thirty</option>
        </NativeSelect>
        <FormHelperText>Placeholder</FormHelperText>
      </FormControl>
      <FormControl required className={classes.formControl}>
        <InputLabel htmlFor="age-native-required">Age</InputLabel>
        <Select
          native
          value={state.age}
          onChange={handleChange}
          name="age"
          inputProps={{
            id: 'age-native-required',
          }}
        >
          <option aria-label="None" value="" />
          <option value={10}>Ten</option>
          <option value={20}>Twenty</option>
          <option value={30}>Thirty</option>
        </Select>
        <FormHelperText>Required</FormHelperText>
      </FormControl>
      <FormControl variant="outlined" className={classes.formControl}>
        <InputLabel htmlFor="outlined-age-native-simple">Age</InputLabel>
        <Select
          native
          value={state.age}
          onChange={handleChange}
          label="Age"
          inputProps={{
            name: 'age',
            id: 'outlined-age-native-simple',
          }}
        >
          <option aria-label="None" value="" />
          <option value={10}>Ten</option>
          <option value={20}>Twenty</option>
          <option value={30}>Thirty</option>
        </Select>
      </FormControl>
      <FormControl variant="filled" className={classes.formControl}>
        <InputLabel htmlFor="filled-age-native-simple">Age</InputLabel>
        <Select
          native
          value={state.age}
          onChange={handleChange}
          inputProps={{
            name: 'age',
            id: 'filled-age-native-simple',
          }}
        >
          <option aria-label="None" value="" />
          <option value={10}>Ten</option>
          <option value={20}>Twenty</option>
          <option value={30}>Thirty</option>
        </Select>
      </FormControl>
    </div>
  );
}
